import styled from "styled-components";
import { IoMdSend } from 'react-icons/io';


const ChatFormWrapper = styled.form`
  width:100%;
  height:100%;
  display:flex;
  flex-flow: row wrap;
  position:relative;

  .chatting_input{
    width:100%;
    height:40px;
  }

  .chatting_submit{
    background:none;
    position:absolute;
    right:15px;
    top:5px;
    font-size:20px;
    color: blue;
  }

`;

interface Props { 

}

const ChatForm = ({  }:Props):JSX.Element=> {

  return (
    <ChatFormWrapper>
      <input className="chatting_input" type="text" /> 
      <button className="chatting_submit">
        <IoMdSend/>
      </button>
    </ChatFormWrapper>
  )

}

export default ChatForm;
